import React from "react";
import DeviceList from "../DeviceList";
import DeviceStatus from "./DeviceStatus";
import { css } from "@emotion/react";

function Dashboard() {
  return (
    <div
      css={css`
        display: flex;
        justify-content: space-around;
        align-items: flex-start;
        margin-top: 2rem;
      `}
    >
      <DeviceList />
      <DeviceStatus />
    </div>
  );
}

export default Dashboard;
